E_D("replace into `phome_ecms_game` values('11566','27','0','','','','1','admin','|36|','1','0','1343265180','0','0','0','0','','','11566','0','0','0','0','0','0','三字经11','1343265180','/spic/20120726/9301.jpg','0','1','1343265180','0','3','1','0','','0','','/d/file/swf/3369.swf','667','479','蠃秦氏，始兼并，传二世，楚汉争。 　　高祖兴，汉业建，至孝平，王莽篡。光武兴，为东汉，四百年，终于献。 　　魏蜀吴，争汉鼎，号三国，迄两晋。宋齐继，梁陈承，为南朝，都金陵。 　　北元魏，分东西，宇文周，与高齐。迨至隋，一土宇，不再传，失统绪。','1','','0','','1','/dpic/20120726/9302.jpg','3369','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZWs1cWEzVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3369.swf','http://www.61baobao.com/common/flash/2010/dpic/3369.jpg','http://www.61baobao.com/common/flash/2010/pic/3369.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('11567','27','0','','','','1','admin','|36|','1','0','1343265180','0','0','0','0','','','11567','0','0','0','0','0','0','三字经6','1343265180','/spic/20120726/9264.jpg','0','1','1343265180','0','3','1','0','','0','','/d/file/swf/3374.swf','667','479','自子孙，至玄曾，乃九族，人之伦。 　　父子恩，夫妇从，兄则友，弟则恭；长幼序，友与朋，君则敬，臣则忠。 　　此十义，人所同，当顺叙，勿违背。斩齐衰，大小幼。至缌麻，五服终。 　　礼乐射，御书数，古六艺，今不具。唯书学，人共遵，既识字，讲说文。','1','','0','','1','/dpic/20120726/9266.jpg','3374','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZWs1NlVYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3374.swf','http://www.61baobao.com/common/flash/2010/dpic/3374.jpg','http://www.61baobao.com/common/flash/2010/pic/3374.jpg','0','三个月以上','0','','0','','0','0','0');");
