E_D("replace into `phome_ecms_game` values('11569','27','0','','','','1','admin','|36|','1','0','1343265181','0','0','0','0','','','11569','0','0','0','0','0','0','三字经12','1343265181','/spic/20120726/9307.jpg','0','1','1343265181','0','3','1','0','','0','','/d/file/swf/3368.swf','667','479','唐高祖，起义师，除隋乱，创国基。二十传，三百载，梁灭之，国乃改。 　　梁唐晋，及汉周，称五代，皆有由。炎宋兴，受周禅。十八传，南北混。 　　辽与金，皆称帝，元灭金，绝宋世。舆图广，超前代，九十载，国祚废。 　　太祖兴，国大明，号洪武，都金陵 <br />','1','','0','','1','/dpic/20120726/9308.jpg','3368','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZWs1cVozVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3368.swf','http://www.61baobao.com/common/flash/2010/dpic/3368.jpg','http://www.61baobao.com/common/flash/2010/pic/3368.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('11570','27','0','','','','1','admin','|36|','1','0','1343265181','0','0','0','0','','','11570','0','0','0','0','0','0','三字经7','1343265181','/spic/20120726/9271.jpg','0','1','1343265181','0','3','1','0','','0','','/d/file/swf/3373.swf','667','479','有古文，大小篆，隶草继，不可乱。 　　若广学，惧其繁，但略说，能知源。凡训蒙，须讲究，详训诂，明句读。 　　为学者，必有初，小学终，至四书。论语者，二十篇，群弟子，记善言。 　　孟子者，七篇止，讲道德，说仁义。作中庸，子思笔，中不偏，庸不易。','1','','0','','1','/dpic/20120726/9272.jpg','3373','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZWs1NlRYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3373.swf','http://www.61baobao.com/common/flash/2010/dpic/3373.jpg','http://www.61baobao.com/common/flash/2010/pic/3373.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('11571','27','0','','','','1','admin','|36|','1','0','1343265181','0','0','0','0','','','11571','0','0','0','0','0','0','三字经13','1343265181','/spic/20120726/9312.jpg','0','1','1343265181','0','3','1','0','','0','','/d/file/swf/3367.swf','667','479','迨成祖，迁燕京，十六世，至崇祯。 　　权阉肆，寇如林，李闯出，神器焚。清世祖，膺景命，靖四方，克大定。 　　由康雍，历乾嘉。民安富，治绩夸。道咸间，变乱起。始英法，扰都鄙。 　　同光后，宣统弱。传九帝，满清殁。革命兴，废帝制。立宪法，建民国。','1','','0','','1','/dpic/20120726/9314.jpg','3367','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZWs1cVkzVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3367.swf','http://www.61baobao.com/common/flash/2010/dpic/3367.jpg','http://www.61baobao.com/common/flash/2010/pic/3367.jpg','0','三个月以上','0','','0','','0','0','0');");
