E_D("replace into `phome_ecms_game` values('11573','27','0','','','','1','admin','|36|','1','0','1343265182','0','0','0','0','','','11573','0','0','0','0','0','0','三字经8','1343265182','/spic/20120726/9276.jpg','0','1','1343265182','0','3','1','0','','0','','/d/file/swf/3372.swf','667','479','作大学，乃曾子，自修齐，至平治。孝经通，四书熟，如六经，始可读。 　　诗书易，礼春秋，号六经，当讲究。有连山，有归藏，有周易，三易详。 　　有典谟，有训诰，有誓命，书之奥。我周公，作周礼，著六官，存治体。 　　大小戴，注礼记，述圣言，礼乐备。','1','','0','','1','/dpic/20120726/9278.jpg','3372','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZWs1NlNYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3372.swf','http://www.61baobao.com/common/flash/2010/dpic/3372.jpg','http://www.61baobao.com/common/flash/2010/pic/3372.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('11574','27','0','','','','1','admin','|36|','1','0','1343265182','0','0','0','0','','','11574','0','0','0','0','0','0','三字经14','1343265182','/spic/20120726/9293.jpg','0','1','1343265182','0','3','1','0','','0','','/d/file/swf/3366.swf','667','479','古今史，全在兹。载治乱，知兴衰。史虽繁，读有次。史记一，汉书二。 　　后汉三，国志四。兼证经，参通鉴。读史者，考实录，通古今，若亲目。 　　口而诵，心而惟，朝于斯，夕于斯。昔仲尼，师项橐，古圣贤，尚勤学。 　　赵中令，读鲁论，彼既仕，学且勤。','1','','0','','1','/dpic/20120726/9294.jpg','3366','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZWs1cVdYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3366.swf','http://www.61baobao.com/common/flash/2010/dpic/3366.jpg','http://www.61baobao.com/common/flash/2010/pic/3366.jpg','0','三个月以上','0','','0','','0','0','0');");
