E_D("replace into `phome_ecms_game` values('11665','25','0','','','','1','admin','','1','0','1343265212','0','0','0','0','','','11665','0','0','0','0','0','0','《客至》杜甫（唐）','1343265212','/spic/20120726/9587.jpg','0','1','1343265212','0','3','1','0','','0','','/d/file/swf/3222.swf','667','479','\\\\\"舍南舍北皆春水，但见群鸥日日来。<br />　　花径不曾缘客扫，蓬门今始为君开。<br />　　盘飧市远无兼味，樽酒家贫只旧醅。<br />　　肯与邻翁相对饮，隔篱呼取尽馀杯。<br />　　1.舍：指成都浣花溪畔的草堂。<br />　　2.皆：都是。<br />　　3.这句说言外之意是说交游冷落，很少有客人来访，即门可罗雀之意。<br />　　4.缘：因为。蓬门，即柴门。<br />　　5.飧：熟食、菜肴。兼味，各种味道的菜食。<br />　　6.旧醅：醅是未经过滤的酒。旧醅，隔年的酒。<br />　　7.尽：喝完。<br />　　8.这二句说，如果客人愿意的话，就把邻居老翁喊过来一起痛痛快快地喝一场。\\\\\"<br />','1','','0','','1','/dpic/20120726/9588.jpg','3222','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZVUxcVNYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3222.swf','http://www.61baobao.com/common/flash/2010/dpic/3222.jpg','http://www.61baobao.com/common/flash/2010/pic/3222.jpg','0','三个月以上','0','','0','','0','0','0');");
