E_D("replace into `phome_ecms_game` values('11761','29','1','','','','1','admin','','1','0','1343265244','0','0','0','1','','','11761','0','0','0','0','0','0','中秋节的由来','1343265244','/spic/20120726/9801.jpg','0','1','1343265244','0','3','1','0','','0','','/d/file/swf/2950.swf','667','479',' 每年农历八月十五日，是传统的中秋佳节。这时是一年秋季的中期，所以被称为中秋。在中国的农历里，一年分为四季，每季又分为孟、仲、季三个部分，因而中秋也称仲秋。八月十五的月亮比其他几个月的满月更圆，更明亮，所以又叫做“月夕”，“八月节”。此夜，人们仰望天空如玉如盘的朗朗明月，自然会期盼家人团聚。远在他乡的游子，也借此寄托自己对故乡和亲人的思念之情。所以，中秋又称“团圆节”。<br />百科常识,儿童动画,儿童FLASH <br />','1','','0','','1','/dpic/20120726/9802.jpg','2950','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBKTlU1VVFYVmpNMlJ0','1','0','http://s.61baobao.com/common/flash/2010/2950.swf','http://www.61baobao.com/common/flash/2010/dpic/2950.jpg','http://www.61baobao.com/common/flash/2010/pic/2950.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('11762','29','0','','','','1','admin','','1','0','1343265244','0','0','0','0','','','11762','0','0','0','0','0','0','星期一到星期日的由来','1343265244','/spic/20120726/9749.jpg','0','1','1343265244','0','3','1','0','','0','','/d/file/swf/2957.swf','667','479','百科常识,儿童动画,儿童FLASH <br />','1','','0','','1','/dpic/20120726/9750.jpg','2957','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBKTlU1VVkzVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/2957.swf','http://www.61baobao.com/common/flash/2010/dpic/2957.jpg','http://www.61baobao.com/common/flash/2010/pic/2957.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('11763','29','0','','','','1','admin','','1','0','1343265245','0','0','0','0','','','11763','0','0','0','0','0','0','人为什么会打呼噜？','1343265245','/spic/20120726/9753.gif','0','1','1343265245','0','3','1','0','','0','','/d/file/swf/3098.swf','667','479','儿童童话,童话寓言,童话FLASH，flash动画,小故事,flash故事,经典小故事,swf<br />','1','','0','','1','/dpic/20120726/9754.gif','3098','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZDA5VVozVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3098.swf','http://www.61baobao.com/common/flash/2010/dpic/3098.gif','http://www.61baobao.com/common/flash/2010/pic/3098.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('11764','29','0','','','','1','admin','','1','0','1343265245','0','0','0','0','','','11764','0','0','0','0','0','0','圣诞节的由来','1343265245','/spic/20120726/9807.jpg','0','1','1343265245','0','3','1','0','','0','','/d/file/swf/2949.swf','667','479','百科常识,儿童动画,儿童FLASH <br />：“圣诞节”这个名称是“基督弥撒”的缩写。弥撒是教会的一种礼拜仪式。圣诞节是一个宗教节日。我们把它当作耶稣的诞辰来庆祝，因而又名耶诞节。这一天，世界所有的基督教会都举行特别的礼拜仪式。但是有很多圣诞节的欢庆活动和宗教并无半点关联。交换礼物，寄圣诞卡，这都使圣诞节成为一个普天同庆的日子。<br />','1','','0','','1','/dpic/20120726/9808.jpg','2949','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBKTlU1RWEzVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/2949.swf','http://www.61baobao.com/common/flash/2010/dpic/2949.jpg','http://www.61baobao.com/common/flash/2010/pic/2949.jpg','0','三个月以上','0','','0','','0','0','0');");
