E_D("replace into `phome_ecms_game` values('11771','29','0','','','','1','admin','','1','0','1343265247','0','0','0','0','','','11771','0','0','0','0','0','0','春节的习俗','1343265247','/spic/20120726/9773.jpg','0','1','1343265247','0','3','1','0','','0','','/d/file/swf/2954.swf','667','479','春节是中国民间最隆重最富有特色的传统节日，一般指除夕和正月初一，又叫阴历年，俗称“过年”。但在民间，传统意义上的春节是指从腊月初八的腊祭或腊月二十三或二十四的祭灶，一直到正月十五，其中以除夕和正月初一为高潮。在春节期间，我国的汉族和很多少数民族都要举行各种活动以示庆祝。这些活动均以祭祀神佛、祭奠祖先、除旧布新、迎禧接福、祈求丰年为主要内容。活动丰富多彩，带有浓郁的民族特色。<br />百科常识,儿童动画,儿童FLASH <br />','1','','0','','1','/dpic/20120726/9775.jpg','2954','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBKTlU1VVVYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/2954.swf','http://www.61baobao.com/common/flash/2010/dpic/2954.jpg','http://www.61baobao.com/common/flash/2010/pic/2954.jpg','0','三个月以上','0','','0','','0','0','0');");
