E_D("replace into `phome_ecms_game` values('11777','29','0','','','','1','admin','','1','0','1343265249','0','0','0','1','','','11777','0','0','0','0','0','0','清明节习俗','1343265249','/spic/20120726/9787.jpg','0','1','1343265249','0','3','1','0','','0','','/d/file/swf/2952.swf','667','479','我国传统的清明节大约始于周代，已有二千五百多年的历史。清明最开始是一个很重要的节气，清明一到，气温升高，正是春耕春种的大好时节，故有“清明前后，种瓜种豆”。“植树造林，莫过清明”的农谚。后来，由于清明与寒食的日子接近，而寒食是民间禁火扫墓的日子，渐渐的，寒食与清明就合二为一了，而寒食既成为清明的别称，也变成为清明时节的一个习俗，清明之日不动烟火，只吃凉的食品<br />百科常识,儿童动画,儿童FLASH <br />','1','','0','','1','/dpic/20120726/9788.jpg','2952','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBKTlU1VVNYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/2952.swf','http://www.61baobao.com/common/flash/2010/dpic/2952.jpg','http://www.61baobao.com/common/flash/2010/pic/2952.jpg','0','三个月以上','0','','0','','0','0','0');");
